@PeterGskrid @sforys92 *gasp*

You care more about what can directly affect you than a more distant war. Unbelievable!

To be serious, I would care more about a hypothetical fire in my backyard than one in the next city over. Reducing support for #Ukraine to "blond hair, blue eyes" is just stupid.

@tubbytowntales @DefenceHQ Also, all of that was 80 years ago, when Russia and Nazi Germany as the aggressors were both invading Ukraine and Poland.

TODAY however, Russia is STILL the aggressor, but Poland and non-Nazi Germany are standing WITH Ukraine.

The one constant is the aggression of Russia.
